import antfu from '@antfu/eslint-config'

export default antfu({
  stylistic: true,
  rules: {
    'ts/method-signature-style': 'off',
  },
}).append({
  files: ['test/**/*.bench.ts'],
  rules: {
    'test/consistent-test-it': 'off',
  },
}, {
  files: ['test/**/*.test.ts'],
  rules: {
    'regexp/no-dupe-disjunctions': 'off',
    'regexp/strict': 'off',
    'regexp/no-useless-assertions': 'off',
    'regexp/no-useless-backreference': 'off',
    'regexp/no-empty-group': 'off',
    'regexp/no-empty-capturing-group': 'off',
    'regexp/no-useless-non-capturing-group': 'off',
    'regexp/no-useless-character-class': 'off',
    'regexp/prefer-d': 'off',
    'regexp/prefer-character-class': 'off',
    'regexp/use-ignore-case': 'off',
    'regexp/optimal-quantifier-concatenation': 'off',
    'regexp/no-useless-quantifier': 'off',
    'regexp/prefer-plus-quantifier': 'off',
  },
}, {
  files: ['docs/**/*'],
  rules: {
    'regexp/prefer-character-class': 'off',
  },
})

import { addImportsSources, addVitePlugin, addWebpackPlugin, defineNuxtModule } from '@nuxt/kit'
import * as magicRegexp from 'magic-regexp'
import { MagicRegExpTransformPlugin } from 'magic-regexp/transform'

export default defineNuxtModule({
  setup(_options, nuxt) {
    addImportsSources({
      from: 'magic-regexp',
      imports: Object.keys(magicRegexp),
    })

    // Disable RegExp code transformation in development mode
    if (nuxt.options.dev)
      return

    addWebpackPlugin(MagicRegExpTransformPlugin.webpack())
    addVitePlugin(MagicRegExpTransformPlugin.vite())
  },
})

{
  "name": "magic-regexp",
  "version": "0.8.0",
  "packageManager": "pnpm@9.15.3",
  "description": "A compiled-away, type-safe, readable RegExp alternative",
  "license": "MIT",
  "repository": {
    "type": "git",
    "url": "git+https://github.com/unjs/magic-regexp.git"
  },
  "sideEffects": false,
  "exports": {
    ".": {
      "import": "./dist/index.mjs",
      "require": "./dist/index.cjs"
    },
    "./converter": {
      "import": "./dist/converter.mjs",
      "require": "./dist/converter.cjs"
    },
    "./transform": {
      "import": "./dist/transform.mjs",
      "require": "./dist/transform.cjs"
    },
    "./further-magic": {
      "import": "./dist/further-magic.mjs",
      "require": "./dist/further-magic.cjs"
    },
    "./nuxt": "./nuxt.mjs"
  },
  "main": "./dist/index.cjs",
  "module": "./dist/index.mjs",
  "types": "./dist/index.d.ts",
  "files": [
    "dist",
    "further-magic.d.ts",
    "nuxt.mjs",
    "transform.d.ts"
  ],
  "scripts": {
    "build": "unbuild",
    "dev": "vitest dev",
    "docs:generate": "nuxi generate docs",
    "lint": "eslint --fix .",
    "prepare": "npx simple-git-hooks && pnpm build",
    "prepublishOnly": "pnpm lint && pnpm test",
    "release": "bumpp && npm publish",
    "test": "vitest run",
    "test:types": "tsc --noEmit"
  },
  "dependencies": {
    "estree-walker": "^3.0.3",
    "magic-string": "^0.30.12",
    "mlly": "^1.7.2",
    "regexp-tree": "^0.1.27",
    "type-level-regexp": "~0.1.17",
    "ufo": "^1.5.4",
    "unplugin": "^2.0.0"
  },
  "devDependencies": {
    "@antfu/eslint-config": "3.12.1",
    "@codspeed/vitest-plugin": "3.1.1",
    "@nuxt/kit": "3.15.1",
    "@types/estree": "1.0.6",
    "@types/node": "22.10.5",
    "@vitest/coverage-v8": "2.1.8",
    "acorn": "8.14.0",
    "bumpp": "9.9.2",
    "eslint": "9.17.0",
    "expect-type": "1.1.0",
    "lint-staged": "latest",
    "rollup": "4.30.0",
    "simple-git-hooks": "2.11.1",
    "typescript": "5.7.2",
    "unbuild": "2.0.0",
    "vite": "6.0.7",
    "vitest": "2.1.8"
  },
  "pnpm": {
    "patchedDependencies": {
      "undocs": "patches/undocs.patch"
    }
  },
  "resolutions": {
    "magic-regexp": "link:.",
    "nuxt": "3.15.1",
    "vite": "6.0.7",
    "vue": "3.5.13"
  },
  "simple-git-hooks": {
    "pre-commit": "npx lint-staged"
  },
  "lint-staged": {
    "*": [
      "npx eslint --fix"
    ]
  }
}

